void Background::SaberColorChange()
{
	if (colorIncreasing)
	{
		if (R.GetR() >= 253)
		{
			colorIncreasing = false;
		}
		else
		{
			R = Color(R.GetR() + 2, R.GetG()  , R.GetB() );
		}

	}
	else
	{
		if (R.GetR() <= 127)
		{
			colorIncreasing = true;
		}
		else
		{
			R = Color(R.GetR() - 2, R.GetG() , R.GetB());
		}

	}
}

